const Banner = () =>{
  return (
    <div className={"banner"}>
      <div className={"banner__content"}>
        <p className={"banner__content__title"}>
          Đăng tin rao bất động sản
        </p>
        <p className={"banner__content__slogan"}>
          hiệu quả hơn bằng công nghệ số
        </p>
        <div 
        className="banner__more" 
        // style={{ border: "2px solid white", height: "50px", width: "200px", borderRadius: "25px", margin: "0px auto", fontSize: '20px' }}
        >
          <p className="banner__more__button">Tìm hiểu thêm</p>
        </div>
      </div>
    </div>
  )
};

export default Banner;
